.code-inspector-container {
  position: fixed;
  pointer-events: none;
  z-index: 9999999999999;
  font-family: 'PingFang SC';
  .margin-overlay {
    position: absolute;
    inset: 0;
    border-style: solid;
    border-color: rgba(255, 155, 0, 0.3);
    .border-overlay {
      position: absolute;
      inset: 0;
      border-style: solid;
      border-color: rgba(255, 200, 50, 0.3);
      .padding-overlay {
        position: absolute;
        inset: 0;
        border-style: solid;
        border-color: rgba(77, 200, 0, 0.3);
        .content-overlay {
          position: absolute;
          inset: 0;
          background: rgba(120, 170, 210, 0.7);
        }
      }
    }
  }
}
.element-info {
  position: absolute;
}
.element-info.hidden {
  visibility: hidden;
}
.element-info-content {
  max-width: 100%;
  font-size: 12px;
  color: #000;
  background-color: #fff;
  word-break: break-all;
  box-shadow: 0 0 10px rgba(0, 0, 0, 0.25);
  box-sizing: border-box;
  padding: 4px 8px;
  border-radius: 4px;
}
.element-info-top {
  top: -4px;
  transform: translateY(-100%);
}
.element-info-bottom {
  top: calc(100% + 4px);
}
.element-info-top-inner {
  top: 4px;
}
.element-info-bottom-inner {
  bottom: 4px;
}
.element-info-left {
  left: 0;
  display: flex;
  justify-content: flex-start;
}
.element-info-right {
  right: 0;
  display: flex;
  justify-content: flex-end;
}
.element-name .element-title {
  color: coral;
  font-weight: bold;
}
.path-line {
  color: #333;
  line-height: 12px;
  margin-top: 4px;
}
.inspector-switch {
  position: fixed;
  z-index: 9999999999999;
  top: 50%;
  right: 24px;
  font-size: 22px;
  transform: translateY(-100%);
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: rgba(255, 255, 255, 0.8);
  color: #555;
  height: 32px;
  width: 32px;
  border-radius: 50%;
  box-shadow: 0px 1px 2px -2px rgba(0, 0, 0, 0.2),
    0px 3px 6px 0px rgba(0, 0, 0, 0.16),
    0px 5px 12px 4px rgba(0, 0, 0, 0.12);
